INSERT INTO `film` (`id`, `Cim`, `Kategoria`, `Mufaj`, `Korhatar`, `Jatekido`, `Gyarto`, `Rendezo`, `Szereplok`, `Leiras`, `EredetiNyelv`, `EredetiCim`, `Szinkron`, `TrailerLink`, `IMDB`, `ImageID`, `Megjegyzes`) VALUES
(1, 'Egy Minecraft film', '2D', ' Vígjáték, Családi', '12', 101, 'USA 2025', 'Jared Hess', 'Jason Momoa, Jack Black, Emma Myers, Danielle Brooks, Jennifer Coolidge', 'Lépj be a Minecraft világába, ahol a kreativitás a minimum – annak, aki életben akar maradni. Négyen vannak: az egyikük a 80-as években volt nagy videójátékos (Jason Momoa), a másik mobilállatkertet üzemeltet (vagyis egy lámát fuvaroz ide-oda az autóján), egy testvérpár (egy fiatal nő és iskolás kisöccse) meg most költözött a városba, és még nem tudja, merre mennyi. Aztán úgy alakul, hogy egy titokzatos átjárón keresztül mindannyian átzuhannak egy izgalmas, kiismerhetetlen és nagyon furcsa másik világba, ahol minden kockákból épül, és csak a képzelet szab neki határt. Ha haza akarnak jutni, akkor rá kell jönniük, mi hogy működik ezen a helyen (és meg kell menekülniük a malac és zombi formájában érkező gonosz lényektől) – ennek érdekében pedig hosszú vándorútra kell indulniuk Steve, a régóta a kockavilágban élő, tapasztalt építőmester (Jack Black) vezetésével. Még szerencse, hogy út közben valamennyien felismernek magukban egy-két addig lappangó képességet, és rájönnek, hogy bennük is pezseg a fantázia: csak hagyni kell szárnyalni.', 'angol', 'A Minecraft Movie', 'magyar', 'https://www.youtube.com/watch?v=ZUqHtdB27uo', '6.5', 25, ''),
(3, 'Paddington Peruban', '2D', 'Vígjáték, Családi', '6', 106, 'United Kingdom 2024', 'Dougal Wilson', 'Antonio Banderas, Olivia Colman, Hugh Bonneville, Emily Mortimer, Julie Walters', 'Paddingtonnal mindig történik valami. Pedig boldogan és elégedetten él Londonban a Brown család padlásszobájában, ám kap egy levelet, és minden a fejére áll. A levél Peruból érkezik, és arról értesíti a kis medvét, hogy eltűnt imádott nagynénje, aki egy Nyugdíjas Medvék Otthonában éldegélt, és bingózással töltötte öreg napjait. Paddington nem habozik, és azonnal Peruba indul, hogy felkutassa Lucy nénit. A Brown család habozik, de azért vele megy. Kalandos, veszélyes és fordulatos útjuk során átvágnak a dzsungelen, hajótörést szenvednek, felkutatják Eldorádót, az elveszett aranyvárost, megküzdenek egy kóros aranylázban szenvedő kalandorral (Antonio Banderas), és végül szembesülnek egy olyan nagy titokkal, ami Paddington egész addigi életét megváltoztathatja…', 'angol', 'Paddington in Peru', 'magyar', 'https://www.youtube.com/watch?v=W6el2dl04BE', '6.7', 24, ''),
(4, 'Sonic, a sündisznó 3', '2D', 'Kalandfilm, Vígjáték, Családi, Fantasy', '12', 110, ' USA 2024', ' Jeff Fowler', 'James Mardsen', 'Sonic, a sündisznó visszatér a mozivászonra karácsonykor az eddigi legizgalmasabb kalandjával. Sonic, Knuckles és Tails összefognak egy veszélyes új ellenféllel, Shadow-val szemben, aki egy rejtélyes gonosztevő, és olyan ereje van, amilyennel még egyiküknek sem volt dolga. És mivel a Sonic csapat képességeit ez a kihívás minden szempontból meghaladja, keresniük kell egy váratlan szövetségest, hogy megállítsák Shadow-t, és megvédjék a bolygót…', 'angol', 'Sonic the Hedgehog 3', 'magyar', 'https://www.youtube.com/watch?v=glg2dVvjnMI', '6.9', 34, '');
