(294, 'https', 'localhost:7153', '/api/Film/add', '', 'Accept: application/json, text/plain, */*\nHost: localhost:7153\nUser-Agent: Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/134.0.0.0 Safari/537.36\nAccept-Encoding: gzip, deflate, br, zstd\nAccept-Language: en-GB,en-US;q=0.9,en;q=0.8\nContent-Type: multipart/form-data; boundary=----WebKitFormBoundary8HMoWXIaAMxUInwa\nCookie: accessToken=eyJhbGciOiJIUzUxMiIsInR5cCI6IkpXVCJ9..6JtkcPfbmXDTpsX5k2nbCd-AZEX5pTK7sjQcdGm6O2TUaOT-JsBTRJ80r1kVNRlrpqr8fsGU1sNq3Umib0YTdw; refreshToken=37B3A152E9E3021F1A1BB8DA298E787C0E26C56D2DD34784C26DFEE6272B16D3\nOrigin: https://localhost:60769\nReferer: https://localhost:60769/\nContent-Length: 2628\nsec-ch-ua-platform: \"Windows\"\nsec-ch-ua: \"Chromium\";v=\"134\", \"Not:A-Brand\";v=\"24\", \"Google Chrome\";v=\"134\"\nDNT: 1\nsec-ch-ua-mobile: ?0\nsec-fetch-site: same-site\nsec-fetch-mode: cors\nsec-fetch-dest: empty\npriority: u=1, i\n', 'Content-Disposition: form-data; name=\"Cim\"\r\nValue: Paddington Peruban\r\nContent-Disposition: form-data; name=\"Kategoria\"\r\nValue: 2D\r\nContent-Disposition: form-data; name=\"Mufaj\"\r\nValue: Vígjáték, Családi\r\nContent-Disposition: form-data; name=\"Korhatar\"\r\nValue: 6\r\nContent-Disposition: form-data; name=\"Jatekido\"\r\nValue: 106\r\nContent-Disposition: form-data; name=\"Gyarto\"\r\nValue: United Kingdom 2024\r\nContent-Disposition: form-data; name=\"Rendezo\"\r\nValue: Dougal Wilson\r\nContent-Disposition: form-data; name=\"Szereplok\"\r\nValue: Antonio Banderas, Olivia Colman, Hugh Bonneville, Emily Mortimer, Julie Walters\r\nContent-Disposition: form-data; name=\"Leiras\"\r\nValue: Paddingtonnal mindig történik valami. Pedig boldogan és elégedetten él Londonban a Brown család padlásszobájában, ám kap egy levelet, és minden a fejére áll. A levél Peruból érkezik, és arról értesíti a kis medvét, hogy eltűnt imádott nagynénje, aki egy Nyugdíjas Medvék Otthonában éldegélt, és bingózással töltötte öreg napjait. Paddington nem habozik, és azonnal Peruba indul, hogy felkutassa Lucy nénit. A Brown család habozik, de azért vele megy. Kalandos, veszélyes és fordulatos útjuk során átvágnak a dzsungelen, hajótörést szenvednek, felkutatják Eldorádót, az elveszett aranyvárost, megküzdenek egy kóros aranylázban szenvedő kalandorral (Antonio Banderas), és végül szembesülnek egy olyan nagy titokkal, ami Paddington egész addigi életét megváltoztathatja…\r\nContent-Disposition: form-data; name=\"EredetiNyelv\"\r\nValue: angol\r\nContent-Disposition: form-data; name=\"EredetiCim\"\r\nValue: Paddington in Peru\r\nContent-Disposition: form-data; name=\"Szinkron\"\r\nValue: magyar\r\nContent-Disposition: form-data; name=\"TrailerLink\"\r\nValue: https://www.youtube.com/watch?v=W6el2dl04BE\r\nContent-Disposition: form-data; name=\"IMDB\"\r\nValue: 6.7/10\r\nContent-Disposition: form-data; name=\"Megjegyzes\"\r\nValue: \r\nContent-Disposition: form-data; name=\"imageId\"\r\nValue: 24\r\n', 'Content-Type: application/json; charset=utf-8\nContent-Length: 38\n', '{\"errorMessage\":\"Sikeres hozzáadás\"}', 200, '2025-04-05 12:49:03.471182'),
