 egy Nyugdíjas Medvék Otthonában éldegélt, és bingózással töltötte öreg napjait. Paddington nem habozik, és azonnal Peruba indul, hogy felkutassa Lucy nénit. A Brown család habozik, de azért vele megy. Kalandos, veszélyes és fordulatos útjuk során átvágnak a dzsungelen, hajótörést szenvednek, felkutatják Eldorádót, az elveszett aranyvárost, megküzdenek egy kóros aranylázban szenvedő kalandorral (Antonio Banderas), és végül szembesülnek egy olyan nagy titokkal, ami Paddington egész addigi életét megváltoztathatja…\r\nContent-Disposition: form-data; name=\"EredetiNyelv\"\r\nValue: angol\r\nContent-Disposition: form-data; name=\"EredetiCim\"\r\nValue: Paddington in Peru\r\nContent-Disposition: form-data; name=\"Szinkron\"\r\nValue: magyar\r\nContent-Disposition: form-data; name=\"TrailerLink\"\r\nValue: https://www.youtube.com/watch?v=W6el2dl04BE\r\nContent-Disposition: form-data; name=\"IMDB\"\r\nValue: 6.7\r\nContent-Disposition: form-data; name=\"Megjegyzes\"\r\nValue: \r\nContent-Disposition: form-data; name=\"imageId\"\r\nValue: 24\r\n', 'Content-Type: application/json; charset=utf-8\nContent-Length: 39\n', '{\"errorMessage\":\"Sikeres módosítás\"}', 200, '2025-04-06 20:48:37.384558'),
